#include "model.hpp"
void Model::start(aiv::indx<2> offset){
    auto data_crop = data.crop( offset, data.N, Indx(1,1));
    double X = offset[0];
    double Y = offset[1];
    data_crop[Indx(0,0)].g = 0;
    data_crop[Indx(0,0)].f = 0;
}
void Model::start_delta(aiv::indx<2> offset){
    auto data_crop = data.crop( offset, data.N, Indx(1,1));
    double X = offset[0];
    double Y = offset[1];
    data_crop[Indx(0,0)].g = 0;
    data_crop[Indx(0,0)].f = 1.0/sqrt(pow(dx, 2)+pow(dy, 2));
}
